import React from "react";
import { Link } from "react-router-dom";

export default function Categories(props) {
  return (
    <div>
      <h3>Categories</h3>
      {props.categories.map(category => (
        <React.Fragment key={category.id}>
          <Link to={`/dances/${category.id}`}>

          </Link>
        </React.Fragment>
      ))}
    </div>
  );
}
